import React from "react";
import Hero from "../components/Hero";
import Container from "../components/Container";
import Background from "../images/summa.png";

function Home() {
  return (
    <Hero backgroundImage={Background}>
      <p>hello</p>
    </Hero>
  )
  return (
    <Container>
      <p>hi again</p>
    </Container>
  );
}

export default Home;
